function ProductCart({ cart }) {
    return (
        <div id="cart" className="page" style={{ display: 'none '}}>
            <h2>Your Cart</h2>
            {cart.length === 0 ? (
                <p>Your cart is empty</p>
            ) : (
                cart.map((item, index) => (
                    <div key={index} className="cart-item">
                        <h3>{item.name}</h3>
                        <p>Price: ${item.price}</p>
                    </div>
                ))
            )}
        </div>
    );
}

export default ProductCart;
